text:
Da tempo allevatori, associazioni di categoria e cacciatori lanciano allarmi sul forte rischio di diffusione della malattia legato all'eccessiva proliferazione dei cinghiali. Se la Psa si diffondesse sarebbe un danno enorme per gli #allevamenti.
@TargatoCN
https://t.co/70Q1HfR0Bg

Giusto ricordare la particolarità di Venezia e non dimentichiamo le altre isole.
I cittadini delle isole, magari minorenni, che hanno LEGITTIMAMENTE scelto di non vaccinarsi non possono essere privati dei servizi di base solo perchè abitano in una piccola isola.
@giglionews https://t.co/TKTJRmL4qS

@mrfrancescato @DeborahBergamin @grotondi Lo sa benissimo. 
Non intende il dibattito parlamentare. Ma quello politico.
Certo che pur di stare lì col ditino alzato...

